import React from 'react';
import { Link } from 'react-router-dom';


function Navbar() {
    return (
        <nav
            style={{
                display: 'flex',
                justifyContent: 'space-between',
                alignItems: 'center',
                padding: '1rem',
                backgroundColor: '#007BFF',
                color: 'white',
                fontFamily: 'Arial, sans-serif',
            }}
        >
            <div style={{ display: 'flex', alignItems: 'center' }}>

                <h1 style={{ margin: 0 }}>FNL</h1>
            </div>
            <div style={{
                display: 'flex',
                justifyContent: 'space-evenly',
                gap: '3rem',
                padding: '1rem',
                color: 'white',
                fontFamily: 'Arial, sans-serif',
            }}>
                <Link to='/' style={{ textDecoration: 'none', color: 'white', fontSize: '1.2rem', marginRight: '1rem' }}>
                    Home
                </Link>

                <Link to='/Game' style={{ textDecoration: 'none', color: 'white', fontSize: '1.2rem' }}>
                    Game
                </Link>
                <Link to='/Results' style={{ textDecoration: 'none', color: 'white', fontSize: '1.2rem' }}>
                    Results
                </Link>
            </div>
        </nav>
    );
}

export default Navbar;
